import { useState } from 'react';
import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';

const Form = () => {
    const [key, setKey] = useState('get');

    return (
        <div>
            <Tabs activeKey={key} onSelect={(k) => setKey(k)} className='form'>
                <Tab eventKey="get" title="Get">
                Tab content for Get
                </Tab>
            </Tabs>
        </div>
    )

} 

export default Form
